// ALTERNATE APPROACH - BETTER OPTIMIZATION
const findLongestSubstringLength = str => {
    if (str.length < 1) return 0; // edge case
    let alpha = "abcdefghijklmnopqrstuvwxyz".split("");
    let longest = 1;
    alpha.forEach(letter => {
        if (str.includes(letter)) {
            let tally = 1;
            while (str.includes(letter.repeat(tally + 1))) tally++;
            if (tally > longest) longest = tally;
        }
    });
    return longest;
};

// TEST IT
console.log(findLongestSubstringLength(string1));
console.log(findLongestSubstringLength(string2));
console.log(findLongestSubstringLength(string3));

// EDGE CASES
console.log(findLongestSubstringLength("a"));
console.log(findLongestSubstringLength(""));
console.log(findLongestSubstringLength(""));

